import React from 'react'
import Styles from './main.module.css'
export default class Login extends React.Component{

    render(){
     return (
         <div>
             <form> 
             <label className = {Styles.input} for ='username'> USERNAME  </label><input id = "username"></input>
             <label className ={Styles.input} for ='password'> PASSWORD</label><input id = "password"></input>
             <button className = {Styles.button}> Login</button>

            </form>

         </div>
     )
    }
}
